from CONSTANT.index import *

class Seeds():
    def __init__(self, mysql):
        self.mysql = mysql

        self.mysql.query.execute(f"ALTER DATABASE {DATABASE_NAME} DEFAULT CHARACTER SET UTF8;") # MySQL will store unicode characters intact such as rupee symbol
        self.mysql.query.execute(f"USE {DATABASE_NAME}")

        # Seeding to SHOP TABLE
        self.seed_shop_table()

        # Seeding to USER TABLE
        self.seed_user_table()

        # Seeding to USER LOGS TABLE
        self.seed_user_logs_table()
        
        # Seeding to CATEGORY TABLE
        self.seed_category_table()
        
        # Seeding to SUB-CATEGORY TABLE
        self.seed_sub_category_table()
        
        # Seeding to SUPPLIER TABLE
        self.seed_supplier_table()
        
        # Seeding to PRODUCT TABLE
        self.seed_product()
    
        # Seeding to PRODUCT_LOGS TABLE
        self.seed_product_logs()

        # Seeding to SALES TABLE
        self.seed_sales_order()

        # Seeding to SALES_ORDER_PRODUCT TABLE
        self.seed_sales_order_product()

        # Seeding to SALES ORDER LOGS TABLE
        self.seed_sales_order_logs()

        # Seeding to PURCHASE ORDER TABLE
        self.seed_purchase_order()

        # Seeding to PURCHASE_ORDER_PRODUCT TABLE
        self.seed_purchase_order_product()

        # Seeding to PURCHASE ORDER LOGS TABLE
        self.seed_purchase_order_logs()

        # Seeding to RETURN_CANCEL ORDER TABLE
        self.seed_return_cancel_order()

        # Seeding to RETURN_CANCEL_ORDER_PRODUCT TABLE
        self.seed_return_cancel_order_product()
        
    

